import React from "react";
import { Col } from "react-bootstrap";

const ProjectCard = ({ titel, descripation, imgeUrl }) => {
  return (
    <Col>
      <div>
        <img src={imgeUrl} alt="..." />
        <h4>{titel}</h4>
        <span>{descripation}</span>
      </div>
    </Col>
  );
};

export default ProjectCard;
